(1, 1, 1, NULL, '2019-12-28 12:14:29', '2020-01-28 14:26:51', 'a1f7f4f6-25b2-4535-8f43-a06d213509c4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 1, 'Ach, Diese Lücke, Diese Entsetliche Lücke', '2019-12-28 16:00:43', '2019-12-28 16:03:14', '48054987-7a47-45ed-a25a-6917ba802c30', 'Livemittschnitt der ungekürzten Lesung mit Joachim Meyerhoff, aufgenommen an sieben Abenden im Deutschen Schauspielhaus Hamburg.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 1, 'Home', '2019-12-28 16:11:53', '2020-01-28 12:31:54', '90237c8e-e782-41cd-a07f-5733e6f91178', NULL, 'Bereits seit 2006 widmet sich •stück•werke• Die Kulturfirma der Produktion von Hörbüchern in enger Zusammenarbeit mit renommierten Hörbuchverlagen.\nFür die akustische Umsetzung der literarischen Texte werden passend zum jeweiligen Stoff, Thema oder Rolle Sprecher*innen besetzt.\nViele literarischen Werke gewinnen erst durch das schauspielerische Können und die Kreativität der Sprecher*innen an Tiefe und Lebendigkeit und werden zu fasziniernden Hörerlebnissen.\nMit feinfühliger und kenntnisreicher Regie, technisch ausgewogenen Tonaufnahmen und einer umfassenden Postproduktion im Tonstudio trägt •stück•werke• Die Kulturfirma zum Erfolg dieses einzigartigen Mediums bei.', NULL, NULL, 'Highlights', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 1, 'test', '2019-12-28 16:33:49', '2019-12-28 16:33:59', '4f02b66d-001f-41fb-9152-176afa3599fb', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
