(367, 435, 1, 'Podcast & Event', '2020-01-22 15:05:02', '2020-01-22 15:05:02', '18291699-8b8f-48e1-a205-ba8bdf94659d', NULL, 'Audio-Recording und Postproduktion in unserem Aufnahmestudio ist selbstverständlich von höchster Qualität.Wir realisieren auch Live-Aufnahmen mit flexiblen Raumlösungen für mehrere Sprecher*innen, bei denen Zuschauer*innen aktiv zuhörender Bestandteil einer lebendigen Live-Situation werden. Podcastproduktionen mit mehreren Gespächspartnern in lockerer Runde, eine außergewöhnliche Live-Lesung für ausgewählte Gäste oder ein musikalischer Event.Die Intensität und Lebendigkeit von Live-Aufnahmen in unserem historischen Kontorgebäude läßt eine Hörproduktion zu einem einzigartigen Produkt werden.', NULL, NULL, 'Podcast & Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
