(492, 629, 1, 'Podcast & Event', '2020-01-28 14:59:53', '2020-01-28 14:59:53', '5b6c1422-d373-45ff-920e-d6e1d43e001e', NULL, 'Audio-Recording und Postproduktion in unserem Aufnahmestudio ist selbstverständlich von höchster Qualität.\nWir realisieren auch Live-Aufnahmen mit flexiblen Raumlösungen für mehrere Sprecher*innen, bei denen Zuschauer*innen aktiv zuhörender Bestandteil einer lebendigen Live-Situation werden.\nPodcastproduktionen mit mehreren Gespächspartnern in lockerer Runde, eine außergewöhnliche Live-Lesung für ausgewählte Gäste oder ein musikalischer Event.\nDie Intensität und Lebendigkeit von Live-Aufnahmen in unserem historischen Kontorgebäude läßt eine Hörproduktion zu einem einzigartigen Produkt werden.', NULL, NULL, 'Podcast & Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(493, 632, 1, 'Über uns', '2020-01-28 15:01:24', '2020-01-28 15:01:24', '37478709-3202-4820-8d6a-9bc411d58e1c', NULL, 'Es gibt vieles zu sagen, vieles zu erzählen und vieles zu berichten.\nJedes Wort, jeder Satz und jeder Ton ist eine Geschichte, die gehört werden möchte.\n•stück•werke• unterstützt Sie, Ihre Botschaft akustisch in das passende Format zu setzen.', NULL, NULL, 'Über •stück•werke•', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(494, 635, 1, 'Burn-out', '2020-01-28 16:00:55', '2020-01-28 16:00:55', '733d8bd1-c662-4c24-873c-92ffa17edd8e', 'Exklusive Live-Veranstaltung anläßlich der Hörbuchaufnahmen in Kooperation mit Buchhandlung Christiansen, Hamburg.\nLivemitschnitt von Vortrag und Lesung mit Dr. med. Mirriam Prieß, aufgenommen an vier Abenden bei •stück•werke• Die Kulturfirma.', NULL, 'Mirriam Prieß', '[{\"col1\":\"Random House Audio\"},{\"col1\":\"Hörbuch MP3-CD, 1 CD, Laufzeit: ca. 460 Minuten\"},{\"col1\":\"ISBN: 978-3-8371-4840-4\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(495, 636, 1, 'Podcast & Event', '2020-01-28 16:03:57', '2020-01-28 16:03:57', 'f9df5a1a-e4d8-4460-afcb-3f9f2a40d060', NULL, 'Audio-Recording und Postproduktion in unserem Aufnahmestudio ist selbstverständlich von höchster Qualität.\nWir realisieren auch Live-Aufnahmen mit flexiblen Raumlösungen für mehrere Sprecher*innen, bei denen Zuschauer*innen aktiv zuhörender Bestandteil einer lebendigen Live-Situation werden.\nPodcastproduktionen mit mehreren Gespächspartnern in lockerer Runde, eine außergewöhnliche Live-Lesung für ausgewählte Gäste oder ein musikalischer Event.\nDie Intensität und Lebendigkeit von Live-Aufnahmen in unserem historischen Kontorgebäude läßt eine Hörproduktion zu einem einzigartigen Produkt werden.', NULL, NULL, 'Podcast & Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(496, 639, 1, 'Welch ein Singen, Musizieren', '2020-01-28 16:07:31', '2020-01-28 16:07:31', 'a72e7ee2-a1e7-4680-b9c8-46f497652b1c', 'Kinderlieder und Gedichte, gesprochen von Nina Petri, Hannelore Hoger, Stefan Kurt, Bibiana Beglau und Patrick Heyn.\nEs singt die Kinder- und Jugendkantorei St. Petri/St. Katharinen Hamburg, begleitet vom Jourist Quartett.\nEine Produktion von •st+ck•werke• Die Kulturfirma', NULL, 'Nina Petri', '[{\"col1\":\"Verlag Hörbuch Hamburg\"},{\"col1\":\"1 CDs, Laufzeit: 66 Minuten\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
