er Daten in Logfiles ist für den Betrieb der Internetseite zwingend erforderlich. Es besteht folglich seitens des Nutzers keine Widerspruchsm*glichkeit.</p><p>• Die Internetseiten von •stück•werke• Die Kulturfirma verwenden keine Cookies. Cookies sind Textdateien, welche über einen Internetbrowser auf einem Computersystem abgelegt und gespeichert werden.</p>', NULL, NULL),
