(118, 587, 1, '2020-01-28 14:44:12', '2020-01-28 14:44:12', '409f78eb-81bf-48d7-9da0-5d2bcf321c3a', NULL, '<h2>Allgemeine Datenschutzerklärung</h2><p>• Beschreibung und Umfang der Datenverarbeitung Bei jedem Aufruf unserer Internetseite erfasst unser System automatisiert Daten und Informationen vom Computersystem des aufrufenden Rechners.</p><p>Folgende Daten werden hierbei erhoben: Informationen +ber den Browsertyp und die verwendete Version Das Betriebssystem des Nutzers Den Internet-Service-Provider des Nutzers Die IP-Adresse des Nutzers Datum und Uhrzeit des Zugriffs Websites, von denen das System des Nutzers auf unsere Internetseite gelangt Websites, die vom System des Nutzers +ber unsere Website aufgerufen werden</p><p>Die Daten werden gegebenenfalls in den Logfiles unseres Systems gespeichert. Die IP-Adressen des Nutzers oder andere Daten, die die Zuordnung der Daten zu einem Nutzer erm*glichen werden in diesen Logfiles anonymisiert. Eine Speicherung dieser Daten zusammen mit anderen personenbezogenen Daten des Nutzers findet in keinem Fall statt.</p><p>• Rechtsgrundlage f+r die Datenverarbeitung Rechtsgrundlage f+r die vor+bergehende Speicherung der Daten ist Art. 6 Abs. 1 lit. f DSGVO.</p><p>• Zweck der Datenverarbeitung Die vor+bergehende Speicherung der IP-Adresse durch das System ist notwendig, um eine Auslieferung der Website an den Rechner des Nutzers zu erm*glichen. Hierf+r muss die IP-Adresse des Nutzers f+r die Dauer der Sitzung gespeichert bleiben. In diesen Zwecken liegt auch unser berechtigtes Interesse an der Datenverarbeitung nach Art. 6 Abs. 1 lit. f DSGVO.</p><p>• Dauer der Speicherung Die Daten werden gel*scht, sobald sie für die Erreichung des Zweckes ihrer Erhebung nicht mehr erforderlich sind. Im Falle der Erfassung der Daten zur Bereitstellung der Website ist dies der Fall, wenn die jeweilige Sitzung beendet ist.</p><p>• Widerspruchs- und Beseitigungsm*glichkeit Die Erfassung der Daten zur Bereitstellung der Website und die Speicherung der Daten in Logfiles ist für den Betrieb der Internetseite zwingend erforderlich. Es besteht folglich seitens des Nutzers keine Widerspruchsm*glichkeit.</p><p>• Die Internetseiten von •stück•werke• Die Kulturfirma verwenden keine Cookies. Cookies sind Textdateien, welche über einen Internetbrowser auf einem Computersystem abgelegt und gespeichert werden.</p>', NULL, NULL),
(119, 588, 1, '2020-01-28 14:44:28', '2020-01-28 14:46:38', '2cbb544f-3086-42a0-8e47-34369cb9133e', NULL, '<h4>Google-Maps</h4><p>In unserem Internetauftritt setzen wir Google Maps zur Darstellung unseres Standorts sowie zur Erstellung einer Anfahrtsbeschreibung ein. Es handelt sich hierbei um einen Dienst der Google LLC, 1600 Amphitheatre Parkway, Mountain View, CA 94043 USA, nachfolgend nur „Google“ genannt.</p><p>Durch die Zertifizierung nach dem EU-US-Datenschutzschild („EU-US Privacy Shield“) https://www.privacyshield.gov/participant?id=a2zt000000001L5AAI&amp;status=Active</p><p>garantiert Google, dass die Datenschutzvorgaben der EU auch bei der Verarbeitung von Daten in den USA eingehalten werden.</p><p>Um die Darstellung bestimmter Schriften in unserem Internetauftritt zu erm*glichen, wird bei Aufruf unseres Internetauftritts eine Verbindung zu dem Google-Server in den USA aufgebaut.</p><p>Sofern Sie die in unseren Internetauftritt eingebundene Komponente Google Maps aufrufen, speichert Google +ber Ihren Internet-Browser ein Cookie auf Ihrem Endger\'t. Um unseren Standort anzuzeigen und eine Anfahrtsbeschreibung zu erstellen, werden Ihre Nutzereinstellungen und -daten verarbeitet. Hierbei k*nnen wir nicht ausschließen, dass Google Server in den USA einsetzt.</p><p>Rechtsgrundlage ist Art. 6 Abs. 1 lit. f) DSGVO. Unser berechtigtes Interesse liegt in der Optimierung der Funktionalit\'t unseres Internetauftritts.</p><p>Durch die so hergestellte Verbindung zu Google kann Google ermitteln, von welcher Website Ihre Anfrage gesendet worden ist und an welche IP-Adresse die Anfahrtsbeschreibung zu +bermitteln ist.</p><p>Sofern Sie mit dieser Verarbeitung nicht einverstanden sind, haben Sie die M*glichkeit, die Installation der Cookies durch die entsprechenden Einstellungen in Ihrem Internet-Browser zu verhindern. Einzelheiten hierzu finden Sie vorstehend unter dem Punkt „Cookies“.</p><p>Zudem erfolgt die Nutzung von Google Maps sowie der +ber Google Maps erlangten Informationen nach den Google-Nutzungsbedingungen https://policies.google.com/terms?gl=DE&amp;hl=de und den Gesch\'ftsbedingungen f+r Google Maps https://www.google.com/intl/de_de/help/terms_maps.html.</p><p>&amp;berdies bietet Google unter https://adssettings.google.com/authenticated https://policies.google.com/privacy weitergehende Informationen an.</p><h4>Google Fonts</h4><p>In unserem Internetauftritt setzen wir Google Fonts zur Darstellung externer Schriftarten ein. Es handelt sich hierbei um einen Dienst der Google LLC, 1600 Amphitheatre Parkway, Mountain View, CA 94043 USA, nachfolgend nur „Google“ genannt.</p><p>Durch die Zertifizierung nach dem EU-US-Datenschutzschild („EU-US Privacy Shield“) https://www.privacyshield.gov/participant?id=a2zt000000001L5AAI&amp;status=Active</p><p>garantiert Google, dass die Datenschutzvorgaben der EU auch bei der Verarbeitung von Daten in den USA eingehalten werden.</p><p>Um die Darstellung bestimmter Schriften in unserem Internetauftritt zu erm*glichen, wird bei Aufruf unseres Internetauftritts eine Verbindung zu dem Google-Server in den USA aufgebaut.</p><p>Rechtsgrundlage ist Art. 6 Abs. 1 lit. f) DSGVO. Unser berechtigtes Interesse liegt in der Optimierung und dem wirtschaftlichen Betrieb unseres Internetauftritts.</p><p>Durch die bei Aufruf unseres Internetauftritts hergestellte Verbindung zu Google kann Google ermitteln, von welcher Website Ihre Anfrage gesendet worden ist und an welche IP-Adresse die Darstellung der Schrift zu +bermitteln ist.</p><p>Google bietet unter</p><p>https://adssettings.google.com/authenticated</p><p>https://policies.google.com/privacy</p><p>weitere Informationen an und zwar insbesondere zu den M*glichkeiten der Unterbindung der Datennutzung.</p><h4>YouTube</h4><p>In unserem Internetauftritt setzen wir YouTube ein. Hierbei handelt es sich um ein Videoportal der YouTube LLC., 901 Cherry Ave., 94066 San Bruno, CA, USA, nachfolgend nur „YouTube“ genannt.</p><p>YouTube ist ein Tochterunternehmen der Google LLC., 1600 Amphitheatre Parkway, Mountain View, CA 94043 USA, nachfolgend nur „Google“ genannt.</p><p>Durch die Zertifizierung nach dem EU-US-Datenschutzschild („EU-US Privacy Shield“) https://www.privacyshield.gov/participant?id=a2zt000000001L5AAI&amp;status=Active</p><p>garantiert Google und damit auch das Tochterunternehmen YouTube, dass die Datenschutzvorgaben der EU auch bei der Verarbeitung von Daten in den USA eingehalten werden.</p><p>Wir nutzen YouTube im Zusammenhang mit der Funktion „Erweiterter Datenschutzmodus“, um Ihnen Videos anzeigen zu k*nnen. Rechtsgrundlage ist Art. 6 Abs. 1 lit. f) DSGVO. Unser berechtigtes Interesse liegt in der Qualit\'tsverbesserung unseres Internetauftritts. Die Funktion „Erweiterter Datenschutzmodus“ bewirkt laut Angaben von YouTube, dass die nachfolgend noch n\'her bezeichneten Daten nur dann an den Server von YouTube +bermittelt werden, wenn Sie ein Video auch tats\'chlich starten.</p><p>Ohne diesen „Erweiterten Datenschutz“ wird eine Verbindung zum Server von YouTube in den USA hergestellt, sobald Sie eine unserer Internetseiten, auf der ein YouTube-Video eingebettet ist, aufrufen.</p><p>Diese Verbindung ist erforderlich, um das jeweilige Video auf unserer Internetseite +ber Ihren Internet- Browser darstellen zu k*nnen. Im Zuge dessen wird YouTube zumindest Ihre IP-Adresse, das Datum nebst Uhrzeit sowie die von Ihnen besuchte Internetseite erfassen und verarbeiten. Zudem wird eine Verbindung zu dem Werbenetzwerk „DoubleClick“ von Google hergestellt.</p><p>Sollten Sie gleichzeitig bei YouTube eingeloggt sein, weist YouTube die Verbindungsinformationen Ihrem YouTube-Konto zu. Wenn Sie das verhindern m*chten, m+ssen Sie sich entweder vor dem Besuch unseres Internetauftritts bei YouTube ausloggen oder die entsprechenden Einstellungen in Ihrem YouTube-Benutzerkonto vornehmen.</p><p>Zum Zwecke der Funktionalit\'t sowie zur Analyse des Nutzungsverhaltens speichert YouTube dauerhaft Cookies +ber Ihren Internet-Browser auf Ihrem Endger\'t. Falls Sie mit dieser Verarbeitung nicht einverstanden sind, haben Sie die M*glichkeit, die Speicherung der Cookies durch eine Einstellung in Ihrem Internet-Browsers zu verhindern. N\'here Informationen hierzu finden Sie vorstehend unter „Cookies“.</p><p>Weitergehende Informationen +ber die Erhebung und Nutzung von Daten sowie Ihre diesbez+glichen Rechte und Schutzm*glichkeiten h\'lt Google in den unter</p><p>https://policies.google.com/privacy</p><p>abrufbaren Datenschutzhinweisen bereit.</p>', NULL, NULL),
