(141, 634, 1, '2020-01-28 15:01:24', '2020-01-28 15:01:24', '59c9be1f-bb5e-4c05-8f78-96197f11aded', NULL, '<p>Spannend oder unterhaltsam und gleichzeitig fundiert und interesssant vorgetragen, die richtige Dosierung der Emotion und eine überzeugende technische Umsetzung: Hörbuch, Hörspiel, Podcast, Audioguide oder Audioporträt.</p><p>Nutzen Sie unsere jahrelange Erfahrung für die individuelle Gestaltung Ihrer Hörproduktionen und informieren Sie sich auf dieser Website über die vielfältigen Produktionsmöglichkeiten.</p><p>Tonstudio, Veranstaltungsort oder repräsentativer Ort für Ihre Gäste: •stück•werke• Die Kulturfirma finden Sie im Herzen von Hamburg im historischen Kontorhaus direkt am Fleet zwischen Alster und Hamburger Hafen. INSERT INTO `migrations` (`id`, `pluginId`, `type`, `name`, `applyTime`, `dateCreated`, `dateUpdated`, `uid`) VALUES
